CREATE TABLE `city_ciku` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `province` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `city_info_url` varchar(500) DEFAULT NULL COMMENT '城市信息url',
  `city_address_url` varchar(500) DEFAULT NULL COMMENT '城市地区url',
`create_time` datetime NOT NULL COMMENT '创建时间',
`update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最近更新时间',
  PRIMARY KEY (`id`),
KEY `province` (`province`),
KEY `city` (`city`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COMMENT='城市地址词库';


